custom_css:
.flex {
	display: -webkit-box;
	display: -ms-flexbox;
	display: flex;
	-webkit-box-orient: horizontal;
	-webkit-box-direction: normal;
	    -ms-flex-direction: row;
	        flex-direction: row;
	-ms-flex-wrap: wrap;
	    flex-wrap: wrap;
}
.row-reverse {
	-webkit-box-orient: horizontal;
	-webkit-box-direction: reverse;
	    -ms-flex-direction: row-reverse;
	        flex-direction: row-reverse;
}
.flex.column {
	-webkit-box-orient: vertical;
	-webkit-box-direction: normal;
	    -ms-flex-direction: column;
	        flex-direction: column;
}
.flex.column-reverse {
	-webkit-box-orient: vertical;
	-webkit-box-direction: reverse;
	    -ms-flex-direction: column-reverse;
	        flex-direction: column-reverse;
}
.nowrap {
	-ms-flex-wrap: nowrap;
	    flex-wrap: nowrap;
}
.justify-center {
	-webkit-box-pack: center;
	    -ms-flex-pack: center;
	        justify-content: center;
}
.justify-end {
	-webkit-box-pack: end;
	    -ms-flex-pack: end;
	        justify-content: flex-end;
}
.justify-between {
	-webkit-box-pack: justify;
	    -ms-flex-pack: justify;
	        justify-content: space-between;
}
.justify-around {
	-ms-flex-pack: distribute;
	    justify-content: space-around;
}
.align-center {
	-webkit-box-align: center;
	    -ms-flex-align: center;
	        align-items: center;
}
.align-end {
	-webkit-box-align: end;
	    -ms-flex-align: end;
	        align-items: flex-end;
}
.align-stretch {
	-webkit-box-align: stretch;
	    -ms-flex-align: stretch;
	        align-items: stretch;
}
.align-baseline {
	-webkit-box-align: baseline;
	    -ms-flex-align: baseline;
	        align-items: baseline;
}
.home .page-hero {
	background-image:-webkit-linear-gradient(315deg, rgba(102,126,234,0.95) 0%, rgba(118,75,162,0.95) 100%), url(http://generatepressui.test/wp-content/uploads/2019/04/9.jpg);
	background-image:-o-linear-gradient(315deg, rgba(102,126,234,0.95) 0%, rgba(118,75,162,0.95) 100%), url(http://generatepressui.test/wp-content/uploads/2019/04/9.jpg);
	background-image:linear-gradient(135deg, rgba(102,126,234,0.95) 0%, rgba(118,75,162,0.95) 100%), url(http://generatepressui.test/wp-content/uploads/2019/04/9.jpg);;
}
.button {
	font-size: 12px;
	text-transform: uppercase;
	letter-spacing: 1.7px;
	min-width: 200px;
	margin: 8px;
}
.button.rounded {
	border-radius: 10rem;
}
.button.outline {
	color: #f8f9fa;
	background: transparent;
	border: 1px solid #f8f9fa;
}
.button.green {
    color: #f8f9fa;
    background-color: #3cd458;
}
.button.green:hover {
	background-color: #2dce4b;
}
#sticky-navigation.is_stuck {
	background:#f8f9fa;
}
#sticky-navigation.is_stuck a {
	color: #757575;
}
#sticky-navigation.is_stuck li:hover a {
	color: #333;
}
#sticky-navigation.is_stuck .current-menu-item a {
	color: #333;
}
h6 {
	color: #757575;
}
.blue-gradient-overlay {
	background-size: cover;
	background-repeat: no-repeat;
	background-position: center center;
	background-image: -webkit-gradient(linear, right top, left top, from(rgba(0,198,251,0.9)), to(rgba(0,91,234,0.9))), url(http://generatepressui.test/wp-content/uploads/2019/04/1.jpg) !important;
	background-image: -webkit-linear-gradient(right, rgba(0,198,251,0.9) 0%, rgba(0,91,234,0.9) 100%), url(http://generatepressui.test/wp-content/uploads/2019/04/1.jpg) !important;
	background-image: -o-linear-gradient(right, rgba(0,198,251,0.9) 0%, rgba(0,91,234,0.9) 100%), url(http://generatepressui.test/wp-content/uploads/2019/04/1.jpg) !important;
	background-image: linear-gradient(to left, rgba(0,198,251,0.9) 0%, rgba(0,91,234,0.9) 100%), url(http://generatepressui.test/wp-content/uploads/2019/04/1.jpg) !important;
}
.site-footer {
	border-top: 1px solid rgba(117,117,117,0.06);
}
@media (min-width:768px) {
	.inside-footer-widgets {
		display: -webkit-box;
		display: -ms-flexbox;
		display: flex;
		-webkit-box-align: center;
				-ms-flex-align: center;
						align-items: center;
	}
	.site-footer .menu {
		display: -webkit-box;
		display: -ms-flexbox;
		display: flex;
		-webkit-box-pack: justify;
				-ms-flex-pack: justify;
						justify-content: space-between;
	}
}
@media (max-width: 768px) {
	.inside-footer-widgets {
		text-align: center;
	}
	.inside-footer-widgets .navigation-branding .main-title {
		text-align: center;
		margin: 0 auto;
	}
}
.inside-site-info {
	border-top: 1px solid rgba(117,117,117,0.06);
	padding-top: 2rem;
}
img.circle {
	border-radius: 100%;
}
form button,
form input[type="submit"] {
	color: #fff;
	background-color: #50a1ff;
	width:100%;
}
form button:hover,
form input[type="submit"]:hover {
	background-color: #3c96ff;
	color: #fff;
}
